import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';

var big = true;
function changeSize() {
  big = !big;
  console.log("=========== big: " + big);
}
<button onClick={() => changeSize()}>Alternate Size</button>

ReactDOM.render(
  <React.StrictMode>

    <App prop1={"This is the App div..."}  bignotsmall={big}/>

  </React.StrictMode>,
  document.getElementById('root')
);
